import { BrowserRouter,Link,Route,Routes } from 'react-router-dom';
import Prueba from './componentes/Prueba';
import Pruebados from './componentes/Pruebados';
function App() {
  return (
    <BrowserRouter>
      <a href='/p'>prueba</a>
      <a href='/c'>prueba dos</a>
      <Routes>
      <Route path='/p' element={<Prueba/>}/>
      <Route path='/c' element={<Pruebados/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
